import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./pages/Home";


const App = () => {


  return (
    <BrowserRouter>
    <Script defer src="https://pyscript.net/latest/pyscript.js" strategy='beforeInteractive'/>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
